package com.github.lucaseo90;

import org.junit.Assert;
import org.junit.Test;

public class No0028Test {

    No0028 no0028 = new No0028();

    @Test
    public void example01() {
        Assert.assertEquals(2, no0028.strStr("hello", "ll"));
    }

    @Test
    public void example02() {
        Assert.assertEquals(-1, no0028.strStr("aaaaa", "bba"));
    }

    @Test
    public void example03() {
        Assert.assertEquals(0, no0028.strStr("", ""));
    }

    @Test
    public void customExample01() {
        Assert.assertEquals(5, no0028.strStr("abcdefg", "fg"));
    }

    @Test
    public void customExample02() {
        Assert.assertEquals(0, no0028.strStr("lalalallll", "la"));
    }

    @Test
    public void customExample03() {
        Assert.assertEquals(6, no0028.strStr("lalalallll", "ll"));
    }

    @Test
    public void customExample04() {
        Assert.assertEquals(-1, no0028.strStr("ll", "lalalallll"));
    }

    @Test
    public void customExample05() {
        Assert.assertEquals(-1, no0028.strStr("lalalalla", "laa"));
    }

    @Test
    public void testRuntimeErrorErrorOccurredExample01() {
        Assert.assertEquals(0, no0028.strStr("a", ""));
    }

    @Test
    public void testWrongAnswerErrorOccurredExample02() {
        Assert.assertEquals(-1, no0028.strStr("", "a"));
    }

    @Test
    public void testWrongAnswerErrorOccurredExample03() {
        Assert.assertEquals(0, no0028.strStr("a", "a"));
    }

    @Test
    public void testTimeLimitExceededErrorOccurredExample03() {
        Assert.assertEquals(-1, no0028.strStr("",
                ""));
    }
}
